import Client from "./client";
import ClientSlide from "./clientSlide";


const MainFile=()=>{
return(
    <div>
        <Client/>
        <ClientSlide
             key={props.id}
             image={props.Image}
             quoteIcon={props.quoteIcon}
             para={props.para}
             name={props.name}
             title={props.title}
    />
    </div>
)
};
export default MainFile;
